package main

import (
	"bufio"
	"encoding/base64"
	"io/ioutil"
	"os"
	"strings"
)

const ICON_BASE64 = "data:image/x-icon;base64,"
//const ICON_BASE64 = "data:image/png;base64,"

func init() {
	_, err := os.Stat(iconPath)
	if os.IsNotExist(err) {
		createIcon()
	}
}

func createIcon() {
	f, _ := os.Create(iconPath) //创建文件
	base64Img := ICON_BASE64
	index := strings.Index(base64Img, ",")
	base64Img = base64Img[index+1:]
	dec := base64.NewDecoder(base64.StdEncoding, strings.NewReader(base64Img))
	all, _ := ioutil.ReadAll(dec)
	//ioutil.WriteFile(iconPath, all, 0666)
	w := bufio.NewWriter(f)
	w.Write(all)
	w.Flush()
	f.Close()
}
